import React, { Component } from 'react'

export default class Child extends Component {
    constructor(){
        super(props)
    }

    state={
        c_count: this.props.count,
    }

  render() {
    console.log("child render");
    return (
      <div>
        <h1>{this.state.c_count}</h1>
      </div>
    );
  }
}
